  //     return response;
  //   } catch (e) {
  //     console.log(e);
  //   }
  // };

  return (
    <Router>
      <Header />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>

        <Route path="/order">
          <Order />
        </Route>

        {/* <Route path="/login">
            <Login />
          </Route> */}

        <Route path="/checkout">
          <Checkout />
        </Route>

        {/* <Route path="/payment">
            <Header />
            <Elements stripe={promise}>
              <Payment />
            </Elements>
          </Route> */}

        <Route path="/checkout">
          <Checkout />
        </Route>

        <Route path="/">
          <PageNotFound />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
